$Flickering = ""
$Crumbliest = ""
$Centurions = ""
$Culbertson = ""
$Christoper = ""
$Monarchies = ""
$Flippantly = ""
$Cryptogram = ""
$Ceremonies = ""
$Cunningham = ""
$Chrysostom = ""
$Moneymaker = ""
$Forcefully = ""
$Floorboard = ""
$Cudgelling = ""
$Chagrining = ""
$Darjeeling = ""
$Cincinnati = ""
$Monomaniac = ""
$Foreclosed = ""
$Vernacular = ""
$Flatfishes = ""
$Discreeter = ""
$Goalkeeper = ""
$Capistrano = ""

$Modules = @($Flickering,$Crumbliest,$Centurions,$Culbertson,$Christoper,$Monarchies,$Flippantly,$Cryptogram,$Ceremonies,$Cunningham,$Chrysostom,$Moneymaker,$Forcefully,$Floorboard,$Cudgelling,$Chagrining,$Darjeeling,$Cincinnati,$Monomaniac,$Foreclosed,$Vernacular,$Flatfishes,$Discreeter,$Goalkeeper,$Capistrano)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
    Remove-Variable -Name "Decoded"
    Remove-Variable -Name "ScriptBlock"
}
Remove-Variable -Name "Modules"
@("Flickering","Crumbliest","Centurions","Culbertson","Christoper","Monarchies","Flippantly","Cryptogram","Ceremonies","Cunningham","Chrysostom","Moneymaker","Forcefully","Floorboard","Cudgelling","Chagrining","Darjeeling","Cincinnati","Monomaniac","Foreclosed","Vernacular","Flatfishes","Discreeter","Goalkeeper","Capistrano") | ForEach-Object { Remove-Variable -Name $_ }
